import React from "react";

//------------------------------------------------------------------------------------------------

//Stores an registry in the Graphs
export interface registoAvaliacao {
    //registry date
    data: Date, 
    //registry value
    y: number
}

//------------------------------------------------------------------------------------------------

class LoadGraphs extends React.Component<any> {

    constructor(props: any) {

        super(props);
    }

    componentDidMount() {

        //Here update graphs registry by making API calls

        this.props.setDataPeso(
            {data: new Date(2020, 0, 21), y: 98},
            {data: new Date(2020, 3, 2), y: 95},
            {data: new Date(2020, 5, 23), y: 93},
            {data: new Date(2020, 7, 12), y: 88},
            {data: new Date(2020, 10, 18), y: 82}
        );

        this.props.setDataCintura(
            {data: new Date(2020, 0, 21), y: 8},
            {data: new Date(2020, 3, 2), y: 5},
            {data: new Date(2020, 5, 23), y: 3},
            {data: new Date(2020, 7, 12), y: 2.3},
            {data: new Date(2020, 10, 18), y: 2.1}
        );
    }

    render() {

        //temporary
        return(<div></div>);
    }

}

export default LoadGraphs;
